INSERT INTO `t_tests` VALUES (4,'1','返回基站的方法有两种：一是操作基站的消防开关，电梯将自动返回基站。另一种司机将梯转入直驶状态．直接支\r\n行到基站，疏散乘客，然后断开电源或交消防人员使用。','',NULL,'1'),(5,'1','电梯运行中因停电或其他原因突然停梯而造成将乘客困在梯内时，若轿厢不在层站的六区位置内，司机可以从轿埔内\r\n打开轿门和层门，将乘客放出。','',NULL,'0'),(6,'1','电梯运行中困停电或其他原因突然停梯而造成将乘客困在梯内时，若轿厢正好停止在层站的站区范围内，司机可以从轿厢内打开轿门和层门，将乘客放出。','',NULL,'1'),(26,'1','电梯司机在对接操作运行时，应采取点动运行操作。','',NULL,'1'),(27,'1','当轿厢位置高于或低于楼层超过0.5米时，应采用在机房进行人工盘车的方法进行驶援。','',NULL,'1'),(28,'1','援救轿厢内的乘客应从轿外进行。','',NULL,'1'),(29,'1','巡检的顺序一般先从机房开始，然后到轿厢，再到各个层站。检查内容一般先从电源，然后到设备状，再到运行检查','',NULL,'1'),(30,'1','对电梯进行清洁，就是单纯为了卫生，为了好看。','',NULL,'1'),(31,'1','电梯的日常巡检主要是指电梯每天正式投入运行前进行的检查和试运行，它的主要任务不是检修，而是对电梯进行常规的检查、清洁和适当的润滑。','',NULL,'1'),(32,'1','电梯平层后，门不开，将乘客困在轿厢里。这是一种很危险状态，司机应赶紧将乘客放出去','',NULL,'0'),(33,'1','凡机房无人值守的电梯，对讲装置必须接到管理部门的值班处。','',NULL,'1'),(34,'1','电梯钥匙未经业主管理部门人员同意，不得随意使用，因工作需要使用时应做好记录。','',NULL,'1'),(35,'1','在任何情况下应做好电梯钥匙的交接工作，保证做到正确使用，特别要预防电梯钥匙的丢失及误操作。','',NULL,'1'),(36,'1','每天电梯投入运行前，维修人检查照明灯和操纵盘上各按钮、开关、显示是否完好，电梯司机检查轿厢是否清洁。','',NULL,'1'),(38,'2','这是第一个单选题','','{\"A\":\"u7b54u9898u9009u9879A\",\"B\":\"u7b54u9898u9009u9879B\",\"C\":\"u7b54u9898u9009u9879C\",\"D\":\"u7b54u9898u9009u9879D\"}','C'),(40,'3','adfsdf','','{\"A\":\"\\u7b54\\u6848\\u9009\\u9879A \\u7b54\\u6848\\u9009\\u9879A \",\"B\":\"\\u7b54\\u6848\\u9009\\u9879B \\u7b54\\u6848\\u9009\\u9879B \",\"C\":\"\\u7b54\\u6848\\u9009\\u9879C \\u7b54\\u6848\\u9009\\u9879C \",\"D\":\"\\u7b54\\u6848\\u9009\\u9879D \\u7b54\\u6848\\u9009\\u9879D \"}','CD'),(41,'3','asdfasdf','','{\"A\":\"\\u7b54\\u6848\\u9009\\u9879A \\u7b54\\u6848\\u9009\\u9879A \",\"B\":\"\\u7b54\\u6848\\u9009\\u9879B \\u7b54\\u6848\\u9009\\u9879B \",\"C\":\"\\u7b54\\u6848\\u9009\\u9879C \\u7b54\\u6848\\u9009\\u9879C \",\"D\":\"\\u7b54\\u6848\\u9009\\u9879D \\u7b54\\u6848\\u9009\\u9879D \"}','CD'),(42,'1','由司机操纵的电悌在使用中．只要司机在轿厢内，就可以使电梯转入自动运行状态接送乘客．','',NULL,'0'),(43,'1','当发现电梯有异常情况时应将电梯运行到就近的层站，疏散乘客后．停止电梯的使用，通知维修人员进行检修','',NULL,'1'),(44,'1','每天电梯司机打开基站的投入运行钥匙开关后即可运送乘客。','',NULL,'0'),(45,'1','电梯在正常条件下运行，安全钳误动作，电梯司机应立即按下急停开关并通知管理人员及电梯维修人员。','',NULL,'1'),(46,'1','只要管理单位同意你操作电梯，你就是合法的电梯司机。','',NULL,'0'),(47,'1','电梯的轿门、厅门从外观上关闭了，但还不能说电梯门就关好了','',NULL,'1'),(48,'1','正常叫，电梯之所以能够准确停层，足因为安全钳把轿厢固定在轨上。','',NULL,'0'),(49,'1','电梯在正常状态下不允许开门走车，但在检修状态下是可以开门走车的。','',NULL,'0'),(50,'1','电梯停在某层，乘客进入轿厢后，超载信号报警，电梯已经超载，为了使乘客方便，这时电梯司机应主动退出让客优先乘座电梯。','',NULL,'0'),(51,'1','电梯司机必须知道自己操作电梯的额定速度、额定载重量、楼层站数等基本参数，对电梯在建筑物中所处的位置、通道及紧急出口可不了解。','',NULL,'0'),(52,'1','电梯关门过程中，开门按钮不起作用','',NULL,'0'),(53,'1','电梯的每次运行过程分为：起动加速、稳速运行和减速制停三个阶段','',NULL,'1'),(54,'1','电梯处于无司机状态，没有内选，门关闭状态，在有外呼的情况下，电梯能自动运行','',NULL,'1'),(55,'1','强迫换速装置是端站保护之一，当电梯轿厢超过正常换速位置时，其起作用强迫电梯减速。','',NULL,'1'),(56,'1','地坎槽中有异物可能造成电梯无法启动．','',NULL,'1'),(57,'1','乘客召唤电梯时，不要同时按压上、下两个方向的召唤按钮，以提高电梯运行效','',NULL,'1'),(58,'1','平层准确度是指轿厢到站停靠后，其轿厢地坎上平面对层门地坎上平面垂直方向的偏差。','',NULL,'1'),(59,'1','紧急开锁装置为应急需要，在层门外借助层门上的三角钥匙可将层门打开。','',NULL,'1'),(60,'2','703.7935850245818',NULL,'{\"A\":\"u7b54u9898u9009u9879A\",\"B\":\"u7b54u9898u9009u9879B\",\"C\":\"u7b54u9898u9009u9879C\",\"D\":\"u7b54u9898u9009u9879D\"}','C'),(61,'2','405.61370123700584',NULL,'{\"A\":\"u7b54u9898u9009u9879A\",\"B\":\"u7b54u9898u9009u9879B\",\"C\":\"u7b54u9898u9009u9879C\",\"D\":\"u7b54u9898u9009u9879D\"}','C'),(62,'2','916.6877818449286',NULL,'{\"A\":\"u7b54u9898u9009u9879A\",\"B\":\"u7b54u9898u9009u9879B\",\"C\":\"u7b54u9898u9009u9879C\",\"D\":\"u7b54u9898u9009u9879D\"}','C'),(63,'2','366.5978362472708',NULL,'{\"A\":\"u7b54u9898u9009u9879A\",\"B\":\"u7b54u9898u9009u9879B\",\"C\":\"u7b54u9898u9009u9879C\",\"D\":\"u7b54u9898u9009u9879D\"}','C'),(64,'2','82.9258664352129',NULL,'{\"A\":\"u7b54u9898u9009u9879A\",\"B\":\"u7b54u9898u9009u9879B\",\"C\":\"u7b54u9898u9009u9879C\",\"D\":\"u7b54u9898u9009u9879D\"}','C'),(65,'2','314.83585416789714',NULL,'{\"A\":\"u7b54u9898u9009u9879A\",\"B\":\"u7b54u9898u9009u9879B\",\"C\":\"u7b54u9898u9009u9879C\",\"D\":\"u7b54u9898u9009u9879D\"}','C'),(66,'2','325.40170226749194',NULL,'{\"A\":\"u7b54u9898u9009u9879A\",\"B\":\"u7b54u9898u9009u9879B\",\"C\":\"u7b54u9898