,'1','电梯日常维护保养单位应配合电梯检验检测机构对所日常维护保养的电梯进行定期检验。','',NULL,'1'),(288,'1','《机电类特种设备安装改造维修许可规则（试行）》中规定，电梯日常维护保养单位必须取得电梯日常维护保养的资格许可','',NULL,'0'),(289,'1','只从事电梯日常维护保养的单位，不必取得《特种设备安装改造维修许可证》，即可从事电梯日常维护保养工作。','',NULL,'0'),(290,'1','自动扶梯的梯路导轨系统包括主轮和辅轮的全部导轨、反轨、反板，导轨去架及转向壁等','',NULL,'0'),(291,'1','扶手带与梯级为不同驱动装置驱动。','',NULL,'0'),(292,'1','目前大多数自动扶梯采用压簧张紧装置。','',NULL,'1'),(293,'1','自动扶梯或人行道的所有停止运行装置应通过商拄切断主电流，来使自动扶梯和人行通道停止运行','',NULL,'1'),(294,'1','自动扶梯或人行道的开关位置应能在操作前看到整个自动扶梯或人行道','',NULL,'1'),(295,'1','自动扶梯和自动人行道的制停距离越小越好','',NULL,'0'),(296,'1','扶手装置是提供自动扶梯乘客扶于用的，由护壁板、围裙板、内、外盖板、斜角盖板、扶手带及传动系统等组成','',NULL,'1'),(297,'1','电动扶梯常用的丁作制动器有：块式制础器、带式制动器和盘式制动器','',NULL,'1'),(298,'1','自动扶梯和自动人行道停止运行后，必须重新启动','',NULL,'1'),(299,'1','自动扶梯的输送能力由运行速度和梯级宽度决定','',NULL,'1'),(300,'1','扶梯的制动系统包括：工作制动器和附加制功器','',NULL,'1'),(301,'1','自动扶梯按驱动的型式分为曳引式、链条式和齿条式。','',NULL,'0'),(302,'1','门的运动保护装置的作用是，乘客在门的关闭过程中被门扇撞击或可能会被撞击时，保护装置将停止关门动作使门重新自动开启','',NULL,'1'),(303,'1','防超速和断绳的保护装置是安全钳-限速器系统。','',NULL,'1'),(304,'1','防越程保护装置只能防止在运行中控制故障造成的越程，若是由于曳引绳打滑或制动器失效或制动力不足造成轿厢越程，该保护装置是无能为力的。','',NULL,'1'),(305,'1','限速器的动作速度选择只与额定速度有关，而与安全钳型式无关。','',NULL,'0'),(306,'1','在发生轿厢或对重蹲底时起保护作用的足强迫换速开关、限位开关和极限开关。','',NULL,'0'),(307,'1','护脚板的作用是为了防止轿厢平层结束前提前开门或平层后轿厢地坎高出层门地坎时因剪切而伤害脚趾','',NULL,'1'),(308,'1','弹簧缓冲器一般由缓冲橡皮、缓冲座、弹簧、弹簧座等组成，用地脚螺栓固定在底坑基座上。','',NULL,'1'),(309,'1','当电梯额定速度很低时（如小于 0.4m/s轿厢和对重底下的缓冲器也可以使用实体式缓冲块来代替，其材料可用橡胶、木材或其他具有适当弹性的材料制成。','',NULL,'1'),(310,'1','耗能型缓冲器能适用于任何额定速度的电梯。','',NULL,'1'),(311,'1','限速器上的铭牌戍标明使用的工作速度和额定的动作速度，最好还应标明限速器绳的最大张力，必要时应提供型式试验合格证的副本。','',NULL,'1'),(312,'1','电梯可以用摆锤式的离心压杆式限速器','',NULL,'0'),(313,'1','电梯能够稳定在一定的速度下运行是因为有限速器限制电梯速度的原故。','',NULL,'0'),(314,'1','缓冲器是为了提高电梯乘客的舒适性而设计的。','',NULL,'0'),(315,'1','限速器动作进度调定后，其调节部位应有可靠封记。','',NULL,'1'),(316,'1','地坎就是各楼层出入轿厢的地点。','',NULL,'0'),(317,'1','顶层端站是指最高的轿厢停靠站。','',NULL,'1'),(318,'1','紧急开锁装置，在无开锁功作时，开锁装置应自动复位，不能仍保持开锁状态。','',NULL,'1'),(319,'1','门锁的电气触点是验证锁紧状态的重要安全装置，要求与机械锁紧元件（锁钩）间的连接是直接的和不会误动作的，而且当触头粘连时，也能可靠断开。','',NULL,'1'),(320,'1','电梯的门机构有的装有调速装置，有的没有。','